WHAT''S INCLUDED IN OUR RENTAL RATES:

*Flexible contracts:
Stay for 3, 6, 9 or 12 months

*Utilities:
Includes electricity, water & unlimited commercial-grade high-speed internet

*Fully Furnished:
Almost new, modern studio apartments with furniture & fit-out that are stylish and practical. En-suite bathroom, Private kitchen with fridge/freezer, Full oven, Melamine Cook-top; Dishwasher, Aircon, Built-In Cupboards, Roller blinds, Workspace, Smart TV

*Internal Laundry:
For convenience, each apartment includes a 9kg washing machine & dryer combo

*Security:
Access-controlled building with key entry and CCTV

*Common Areas:
The luxury of working from home if you want to. Relax in your apartment or try the sunny garden and residents-only fully furnished lounge room with high-speed wifi and a laptop charging station

*Cleaning & Maintenance:
Our professional team takes care of all common areas

LOCATION:

Randwick Boutique is situated diagonally opposite the Prince of Wales Hospital and near:

*UNI NSW
*The SPOT Café district
*Light Rail
*Newmarket Parks and Restaurants - featuring Ribs n Burgers, and other 
 trendy food and dining experiences
*Royal Randwick Shopping Centre
 
Live and work more affordably and socially while still being able to retreat to the comfort of your own fully furnished, self-contained private apartment. 
 
The apartments are leased at all-inclusive prices, including some essentials you would typically require when moving into a new place. "There are no bills to pay."

Around the corner, numerous trendy eateries, friendly cafés, and essential stores offer residents a wealth of choices. Alternatively, take a walk or a bus to any of the nearby beaches, such as Coogee, Tamarama, or Bondi, or catch an NRL, Footy game, or cricket match at the nearby stadiums.

WHATSAPP
*Floor plans are as attached
*Viewing as advertised or by private appointment', TRUE, TRUE, TRUE, TRUE, TRUE, TRUE, FALSE, FALSE, FALSE, FALSE, FALSE, FALSE, FALSE, TRUE, -33.921938, 151.2404261, '["https://rimh2.domainstatic.com.au/F8rcGFYB1Lhbt5l3N4AAM0AEZqg=/fit-in/1920x1080/filters:format(jpeg):quality(80):no_upscale()/15179242_1_1_210609_123541-w2048-h1365", "https://rimh2.domainstatic.com.au/0tvpsD53QTrlk2HU-54DNC82mtw=/fit-in/1920x1080/filters:format(jpeg):quality(80):no_upscale()/15179242_2_1_210609_123541-w2048-h1365", "https://rimh2.domainstatic.com.au/kzClLgzegftsFHef-_SX-3dkFEU=/fit-in/1920x1080/filters:format(jpeg):quality(80):no_upscale()/15179242_3_1_210609_123541-w2048-h1365", "https://rimh2.domainstatic.com.au/TLKdqqFvRKTnT4wcgnp1-F11uwk=/fit-in/1920x1080/filters:format(jpeg):quality(80):no_upscale()/15179242_4_1_210609_123541-w2048-h1365", "https://rimh2.domainstatic.com.au/nL7VtSIKRc1LOvC8GvmR1GBnTSk=/fit-in/1920x1080/filters:format(jpeg):quality(80):no_upscale()/15179242_5_1_210609_123541-w2048-h1365", "https://rimh2.domainstatic.com.au/Q89ah-posSmxVQ0E2m5H2_EOWsg=/fit-in/1920x1080/filters:format(jpeg):quality(80):no_upscale()/15179242_6_1_210609_123541-w2048-h1365", "https://rimh2.domainstatic.com.au/wBgc5lU7CkItMjfl7msCKLS_Md0=/fit-in/1920x1080/filters:format(jpeg):quality(80):no_upscale()/15179242_7_1_210609_123541-w2048-h1365", "https://rimh2.domainstatic.com.au/oR1WCBE3pvEDQN2nzrPu2vWmtU0=/fit-in/1920x1080/filters:format(jpeg):quality(80):no_upscale()/15179242_8_1_210609_123541-w2048-h1365", "https://rimh2.domainstatic.com.au/SmCL_IH_b6CNtUKCy2C3pZFIlEg=/fit-in/1920x1080/filters:format(jpeg):quality(80):no_upscale()/15179242_9_1_210609_123541-w2048-h1365", "https://rimh2.domainstatic.com.au/Nr-qoaQhohmCZ7nrJMVMypwfBWA=/fit-in/1920x1080/filters:format(jpeg):quality(80):no_upscale()/15179242_10_1_210609_123541-w2048-h1365", "https://rimh2.domainstatic.com.au/UyFry9WlRG44-VNYEZwSZijVwf4=/fit-in/1920x1080/filters:format(jpeg):quality(80):no_upscale()/15179242_11_3_210615_06