WHAT''S INCLUDED IN OUR RENTAL RATES:

*Flexible contracts:
Stay for 3, 6, 9 or 12 months

*Utilities:
Includes electricity, water & unlimited commercial-grade high-speed internet

*Fully Furnished:
Almost new, modern studio apartments with furniture & fit-out that are stylish and practical. En-suite bathroom, Private kitchen with fridge/freezer, Full oven, Melamine Cook-top; Dishwasher, Aircon, Built-In Cupboards, Roller blinds, Workspace, Smart TV

*Internal Laundry:
For convenience, each apartment includes a 9kg washing machine & dryer combo

*Security:
Access controlled building with key entry and CCTV

*Common Areas:
The luxury of working from home if you want to. Relax in your apartment or try the sunny garden and residents-only fully furnished lounge room with hi-speed wifi and a laptop charging station

*Cleaning & Maintenance:
Our professional team takes care of all common areas

LOCATION:

Randwick Boutique is situated diagonally opposite the Prince of Wales Hospital and in close proximity to:

*UNI NSW
*The SPOT Café district
*Light Rail
*Newmarket Parks and Restaurants - featuring Ribs n Burgers, and other 
 trendy food and dining experiences
*Royal Randwick Shopping Centre
 
Live and work more affordably and socially while still being able to retreat to the comfort of your own fully furnished, self-contained private apartment. 
 
The apartments are leased at all-inclusive prices, including some essentials you would normally require when moving into a new place. "There are no bills to pay."

Around the corner, many trendy eateries, friendly cafés, and essential stores spoil residents for choice. Alternatively, take a walk or a bus to any of the nearby beaches, such as Coogee, Tamarama, or Bondi, or catch an NRL, Footy game, or cricket match at the nearby stadiums.

NOTE:
*Communication with the agent is BEST BY EMAIL: DO NOT USE WHATSAPP
