This modern studio apartment has just been renovated and is located conveniently across the road from Pacific Square Shopping Center at Maroubra Junction.
This perfect central location has restaurants, cafes, and transport on the doorstep and a supermarket is directly across the road.
 
The University of NSW and Prince of Wales Hospital are minutes away and easily accessible by public transport at the end of your street. The AJC (Australian Jockey Club) and Alliance Stadium are a short ride away by bus or lightrail and it is a short ride into the city center. The sparkling waters of Maroubra Beach and Coogee Beach are only a few minutes drive away.

This gorgeous studio is a peaceful space if you are working from home and includes a large covered patio for private use which enjoys sunshine all day. There is also an undercover security parking space.
