INSERT INTO properties (listing_id, property_url, address, suburb, state, postcode, property_type, rent_pw, bond, bedrooms, bathrooms, parking_spaces, bedroom_display, agency_name, agent_name, agent_phone, agent_email, property_headline, property_description, has_air_conditioning, is_furnished, has_balcony, has_dishwasher, has_laundry, has_built_in_wardrobe, has_gym, has_pool, has_parking, allows_pets, has_security_system, has_storage, has_study_room, has_garden, latitude, longitude, images, agent_profile_url, enquiry_form_action, geom) VALUES (17550429, 'https://www.domain.com.au/3-sterling-cct-camperdown-nsw-2050-17550429', '3 Sterling Cct, Camperdown NSW 2050', 'Camperdown', 'NSW', 2050, 'Apartment / Unit / Flat', 800, 0, 1, 1, 0, '1', 'Greencliff Agency', 'Michelle Kilala', 419777239, 'michelle@greencliff.com.au', 'LUXE DESIGNER LIVING IN AWARD-WINNING ''TRIO CENTRAL''', '*** LEASED AT RECORD PRICE***

More properties needed, call Michelle on 0419 777 239 if you need helping finding a tenant.

With its serene leafy outlook, sophisticated high-end finishes, and expansive design, this one-bedroom plus study apartment is a standout sanctuary for professionals, downsizers, and investors. Nestled within the renowned, architecturally designed Trio Central tower, it delivers an unmatched fusion of luxury, style, and convenience. Enjoy world-class resort-style facilities, a vibrant café culture, and picturesque parklands, all while being just moments from seamless city transport.

Property Highlights:
- Light-filled open-plan living with floor-to-ceiling glass, seamlessly extending onto a spacious loggia terrace with bi-fold doors perfect for all-weather entertaining
- Spacious bedroom with built-in wardrobes and direct access to the designer bathroom
- Sleek study nook with bespoke joinery ideal for a stylish and functional work-from-home setup
- Gourmet stone kitchen featuring premium Smeg stainless steel appliances, gas cooking and ample storage
- Luxurious designer bathroom with a frameless glass shower, deep soaking bathtub, and dual entry from both the bedroom and hallway
- Concealed internal laundry and updated flooring
- Ducted air-conditioning, lift access, and a secure lock-up storage cage
- World-class amenities including a heated indoor and outdoor pool, two fully equipped gyms
- Secure building with intercom entry and 24-hour security
- Unbeatable locale with stroll to Tramsheds'' buzzing dining precinct and Annandale Village
