Property Features include:

- Small boutique block of just nine apartments on a peaceful tree lined street
- Plentiful natural light thanks to a top floor position which also takes in panoramic district views
- Sundrenched open plan living area with seamless connectivity to the North facing balcony and views
- Dedicated study in addition to the two bedrooms, perfect for the student or those work from home arrangements
- Modern eat-in kitchen with granite benchtops, electric upright stove, rangehood and plenty of storage space
- Two oversized bedrooms, both with built-in robes (please note that robe in the second bedroom is currently being constructed)
- Refreshed bathroom with semi-frameless shower, separate bathtub, toilet and vanity
- Internal laundry and linen storage
- New floating flooring installed to living, study and bedrooms
- New blinds being installed to all bedrooms and living areas
- New built-in robe being constructed at the moment in second bedroom
- Large lock up garage with ample storage space

This location is second to none! Walking distance to Centennial Park, Moore Park, multiple light rail stops, cafes, restaurants, retail, gyms and so much more. Moments to multiple local schools, UNSW and Price of Wales Hospital, Randwick and East Village shopping precincts. Convenient access to the CBD, bayside beaches and Sydney Airport.

Looking to inspect this property?

Click on the "Book Inspection" button, provide us with your contact details and you are registered and ready to go!

Where there are no set advertised inspections, or the times listed don''t suit, click on the "Request an Inspection" button, pop in your contact details and we will be in touch to arrange an inspection.

