Details Of The Apartment:

- Combined lounge and dinning flow to a winter balcony
- stylish kitchen fully appointed with CaeserStone bench top and quality stainless steel Smeg appliances 
- One spacious bedroom with plenty of natural lights through
- Modern bathroom with floor to ceiling tiles
- Internal laundry with washing machine
- close to Sydney Uni, City, cafe''s & shops
- excellent public transport
- minutes to the city
- located in quiet residential street adjacent to Camperdown Park
- striking contemporary architecture
- designed for inner city living
- north facing first floor apartment catches sun all day long
- winter garden style terrace
